/**
 * Environment Configuration Module
 *
 * This module handles environment variables, configuration settings, and logging
 * for the Trading Simulator MCP server.
 *
 * @module env
 */

import chalk from "chalk";

/**
 * Configuration interface for environment variables
 *
 * Defines the structure of configuration variables used throughout the application.
 */
interface Config {
  /** API URL for the Trading Simulator */
  TRADING_SIM_API_URL: string;
  /** API Key for authentication with the Trading Simulator */
  TRADING_SIM_API_KEY: string | undefined;
  /** Debug mode flag to enable additional logging */
  DEBUG: boolean;
}

/**
 * Logger interface for consistent logging
 *
 * Provides standardized logging methods with different severity levels.
 */
interface Logger {
  /** Log error messages */
  error: (...args: any[]) => void;
  /** Log warning messages */
  warn: (...args: any[]) => void;
  /** Log informational messages */
  info: (...args: any[]) => void;
}

/**
 * Custom logger implementation with colored output
 *
 * Uses chalk for colorized terminal output and writes to stderr to avoid
 * interfering with stdout which is used for MCP protocol messages.
 */
export const logger: Logger = {
  error: (...args: any[]) =>
    process.stderr.write(`${chalk.red("[ERROR]")} ${args.join(" ")}\n`),
  warn: (...args: any[]) =>
    process.stderr.write(`${chalk.yellow("[WARN]")} ${args.join(" ")}\n`),
  info: (...args: any[]) =>
    process.stderr.write(`${chalk.blue("[INFO]")} ${args.join(" ")}\n`),
};

/**
 * Configuration object with environment variables and defaults
 *
 * Loads configuration from environment variables with fallbacks to default values.
 */
export const config: Config = {
  TRADING_SIM_API_URL:
    process.env.TRADING_SIM_API_URL || "http://localhost:3000",
  TRADING_SIM_API_KEY: process.env.TRADING_SIM_API_KEY || undefined,
  DEBUG: process.env.DEBUG === "true",
};

// Ensure URL doesn't have trailing slash
if (config.TRADING_SIM_API_URL.endsWith("/")) {
  config.TRADING_SIM_API_URL = config.TRADING_SIM_API_URL.slice(0, -1);
}

/**
 * Validate the environment configuration
 *
 * Checks for required and recommended environment variables.
 * Logs warnings for missing recommended variables and errors for required ones.
 *
 * @returns {void}
 */
export function validateEnv(): void {
  const recommendedVars: (keyof Config)[] = ["TRADING_SIM_API_URL", "DEBUG"];
  const missing: string[] = recommendedVars.filter((v) => !process.env[v]);
  if (missing.length > 0) {
    logger.warn(
      `Missing recommended variables: ${missing.join(", ")}. Using defaults.`,
    );
  }

  if (!config.TRADING_SIM_API_KEY) {
    logger.error(
      "Missing required API key (TRADING_SIM_API_KEY). Please provide an API key to use the trading simulator.",
    );
    return;
  }
}

// Debug startup message
if (config.DEBUG) {
  logger.info("Starting environment setup...");
}

import { expect } from 'chai';
import { config, validateEnv, logger } from '../../src/env.js';

describe('Environment Configuration', () => {
  // Save original environment variables and stderr.write
  const originalEnv = { ...process.env };
  const originalStderrWrite = process.stderr.write;
  let output = '';

  beforeEach(() => {
    // Reset captured output
    output = '';

    // Mock stderr.write to capture output
    process.stderr.write = ((str: string) => {
      output += str;
      return true;
    }) as any;
  });

  afterEach(() => {
    // Restore environment variables and stderr.write
    process.env = { ...originalEnv };
    process.stderr.write = originalStderrWrite;
  });

  it('should have default API URL', () => {
    // Test real configuration without mocks
    expect(config).to.have.property('TRADING_SIM_API_URL');
    expect(config.TRADING_SIM_API_URL).to.be.a('string');
  });

  it('should have debug flag', () => {
    expect(config).to.have.property('DEBUG');
    expect(config.DEBUG).to.be.a('boolean');
  });

  it('should remove trailing slash from API URL', () => {
    // Test directly by modifying the config object
    const originalUrl = config.TRADING_SIM_API_URL;
    config.TRADING_SIM_API_URL = 'http://test.com/';

    // Manually trigger the slash removal logic
    if (config.TRADING_SIM_API_URL.endsWith('/')) {
      config.TRADING_SIM_API_URL = config.TRADING_SIM_API_URL.slice(0, -1);
    }

    expect(config.TRADING_SIM_API_URL).to.equal('http://test.com');

    // Restore original
    config.TRADING_SIM_API_URL = originalUrl;
  });

  it('should log warning for missing recommended vars', () => {
    // Temporarily unset env vars to test warnings
    delete process.env.TRADING_SIM_API_URL;
    delete process.env.DEBUG;

    // Call the real validation function
    validateEnv();

    // Verify warning was logged
    expect(output).to.include('Missing recommended variables');
    expect(output).to.include('TRADING_SIM_API_URL');
    expect(output).to.include('DEBUG');
  });

  it('should log error for missing API key', () => {
    // Ensure API key is not set
    delete process.env.TRADING_SIM_API_KEY;

    // Call the real validation function
    validateEnv();

    // Verify error was logged
    expect(output).to.include('Missing required API key');
    // Verify function returned (implicitly void)
    expect(validateEnv()).to.be.undefined;
  });

  it('should log debug message when DEBUG is true', () => {
    // Set debug to true
    const originalDebug = process.env.DEBUG;
    process.env.DEBUG = 'true';

    // Call a function that would trigger the debug message
    logger.info('Starting environment setup...');

    // Check output has the message
    expect(output).to.include('Starting environment setup');

    // Restore original
    process.env.DEBUG = originalDebug;
  });
});
